import React, {Component} from 'react'
import FeedItem from './feedItem'
import NavigationItem from '../../navigationItem/navigationItem'
import { render } from 'react-dom'

class unregisteredFeed extends Component{

style = {
    overflow: 'scroll',
    height: '350px'
}

feedList = []

shouldComponentUpdate(){
    return true 
}

render(){

    return(
    <div style={this.style}>
        <h1>Unregistered Activity</h1>
        [<FeedItem>abcdef</FeedItem>]
    </div>)}
}


export default unregisteredFeed
